import React from 'react'

class Workout extends React.Component {
    state = {}

    componentDidMount = () => {
        fetch(`/api/workout/${this.props.match}`)
            .then(res => res.json())
            .then(workout => {
                this.setState({workout})
            })
    }

    render() {
        return (
            <div>
                <h1>One workout page</h1>
            </div>
        )
    }
}

export default Workout
